[{"location":"api/#API-Reference","page":"API Reference","title":"API Reference","text":"","category":"section"},{"location":"api/#Storage","page":"API Reference","title":"Storage","text":"","category":"section"},{"location":"api/#Artifacts","page":"API Reference","title":"Artifacts","text":"","category":"section"},{"location":"api/#Sampler","page":"API Reference","title":"Sampler","text":"","category":"section"},{"location":"api/#Pruner","page":"API Reference","title":"Pruner","text":"","category":"section"},{"location":"api/#Study","page":"API Reference","title":"Study","text":"","category":"section"},{"location":"api/#Trial","page":"API Reference","title":"Trial","text":"","category":"section"},{"location":"api/#Optimization","page":"API Reference","title":"Optimization","text":"","category":"section"},{"location":"api/#Optuna.RDBStorage","page":"API Reference","title":"Optuna.RDBStorage","text":"RDBStorage(database_path::String, database_name::String)\n\nStorage class for RDB backends.\n\nArguments\n\ndatabase_path::String: Path to the directory where the database is stored.\ndatabase_name::String: Name of the database file.\n\n\n\n\n\n","category":"type"},{"location":"api/#Optuna.get_all_study_names","page":"API Reference","title":"Optuna.get_all_study_names","text":"get_all_study_names(storage::BaseStorage)\n\nreturns all study names stored in the given storage.\n\nArguments\n\nstorage::BaseStorage: Storage backend to query.\n\nReturns\n\nVector{String}: List of study names.\n\n\n\n\n\n","category":"function"},{"location":"api/#Optuna.FileSystemArtifactStore","page":"API Reference","title":"Optuna.FileSystemArtifactStore","text":"FileSystemArtifactStore(path::String)\n\nData structure for a file system based artifact store.\n\nArguments\n\npath::String: Path to the directory where artifacts are stored.\n\n\n\n\n\n","category":"type"},{"location":"api/#Optuna.ArtifactMeta","page":"API Reference","title":"Optuna.ArtifactMeta","text":"ArtifactMeta\n\nData structure containing metadata for an artifact.\n\n\n\n\n\n","category":"type"},{"location":"api/#Optuna.RandomSampler","page":"API Reference","title":"Optuna.RandomSampler","text":"RandomSampler(seed=nothing::Union{Nothing,Int})\n\nAn independent sampler that samples randomly\n\nArguments\n\nseed::Union{Nothing,Int}=nothing: Seed for the random number generator.\n\n\n\n\n\n","category":"type"},{"location":"api/#Optuna.MedianPruner","page":"API Reference","title":"Optuna.MedianPruner","text":"MedianPruner(n_startup_trials::Int=5,\n    n_warmup_steps::Int=0,\n    interval_steps::Int=1;\n    n_min_trials::Int=1)\n\nPrune a trial if its best intermediate result is below the median of intermediate results of previous completed trials at the same step.\n\nArguments\n\nn_startup_trials::Int=5: Number of initial trials before pruning starts.\nn_warmup_steps::Int=0: Number of steps in a trial before pruning starts.\ninterval_steps::Int=1: Interval in number of steps when the pruner checks, offset by n_warmup_steps.\nn_min_trials::Int=1: Minimum trials needed at a step to trigger pruning. If reported results are below n_min_trials, the trial continues regardless of performance.\n\n\n\n\n\n","category":"type"},{"location":"api/#Optuna.Study","page":"API Reference","title":"Optuna.Study","text":"This data structure represents an Optuna study and its corresponding artifact and data storage. A study is a collection of trials that share the same optimization objective.\n\n\n\n\n\n","category":"type"},{"location":"api/#Optuna.load_study","page":"API Reference","title":"Optuna.load_study","text":"load_study(\n    storage::BaseStorage,\n    study_name::String,\n    artifact_store::BaseArtifactStore;\n    sampler=nothing::Union{Nothing,BaseSampler},\n    pruner=nothing::Union{Nothing,BasePruner},\n)\n\nLoad an existing study with the given name, artifact store, storage, sampler and pruner.\n\nArguments\n\nstudy_name::String: Name of the study.\nartifact_store::BaseArtifactStore: Artifact store for the study. (see Artifacts)\nstorage::BaseStorage: Storage of the study. (see Storage)\n\nKeyword Arguments\n\nsampler::Union{Nothing,BaseSampler}=nothing: Sampler to use for the study. (see Sampler)\npruner::Union{Nothing,BasePruner}=nothing: Pruner to use for the study. (see Pruner)\n\nReturns\n\nStudy: The loaded study. (see Study)\n\n\n\n\n\n","category":"function"},{"location":"api/#Optuna.delete_study","page":"API Reference","title":"Optuna.delete_study","text":"delete_study(\n    study_name::String,\n    storage::BaseStorage,\n)\n\nDelete a study with the given name and storage backend.\n\nArguments\n\nstudy_name::String: Name of the study.\nstorage::BaseStorage: Storage of the study. (see Storage)\n\n\n\n\n\n","category":"function"},{"location":"api/#Optuna.copy_study","page":"API Reference","title":"Optuna.copy_study","text":"copy_study(\n    from_study_name::String,\n    from_storage::BaseStorage,\n    to_storage::BaseStorage,\n    to_study_name::String=\"\",\n)\n\nCopy a study from one storage backend to another.\n\nArguments\n\nfrom_study_name::String: Name of the study to copy.\nfrom_storage::BaseStorage: Storage backend to copy the study from. (see Storage)\nto_storage::BaseStorage: Storage backend to copy the study to. (see Storage)   \nto_study_name::String=\"\": Name of the new study. If empty, the original study name is used.\n\n\n\n\n\n","category":"function"},{"location":"api/#Optuna.ask","page":"API Reference","title":"Optuna.ask","text":"ask(study::Study)\n\nGet a new trial from the study. This is an alternative way to create trials instead of using the optimize function. A trial created this way must be completed using the tell function.\n\nArguments\n\nstudy::Study: The study to get the trial from. (see Study)\n\nReturns\n\nTrial: The new trial. (see Trial)\n\n\n\n\n\n","category":"function"},{"location":"api/#Optuna.tell","page":"API Reference","title":"Optuna.tell","text":"tell(study::Study, trial::Trial, score::Union{Nothing,T,Vector{T}}=nothing; prune::Bool=false\n\n) where {T<:AbstractFloat}\n\nTell the study about the result of a trial. This is the proper way to complete a trial created with the ask function.\n\nArguments\n\nstudy::Study: The study to report the trial to. (see Study)\ntrial::Trial: The trial which was completed. (see Trial)\nscore::Union{Nothing,T,Vector{T}}=nothing: The score of the trial. If nothing, the trial is pruned.\nprune::Bool=false: If true, the trial is pruned.\n\n\n\n\n\n","category":"function"},{"location":"api/#Optuna.best_trial","page":"API Reference","title":"Optuna.best_trial","text":"best_trial(study::Study)\n\nGet the best trial of the study.\n\nArguments\n\nstudy::Study: The study to get the best trial from. (see Study)\n\nReturns\n\ntrial: The best trial. (see Trial)\n\n\n\n\n\n","category":"function"},{"location":"api/#Optuna.best_params","page":"API Reference","title":"Optuna.best_params","text":"best_params(study::Study)\n\nGet the best parameters of the study.\n\nArguments\n\nstudy::Study: The study to get the best parameters from. (see Study)\n\nReturns\n\nparameters: The best parameters.\n\n\n\n\n\n","category":"function"},{"location":"api/#Optuna.best_value","page":"API Reference","title":"Optuna.best_value","text":"best_value(study::Study)\n\nGet the best objective value of the study.\n\nArguments\n\nstudy::Study: The study to get the best objective value from. (see Study)\n\nReturns\n\nvalue: The best objective value.\n\n\n\n\n\n","category":"function"},{"location":"api/#Optuna.upload_artifact","page":"API Reference","title":"Optuna.upload_artifact","text":"upload_artifact(study::Study, trial::Trial, data::Dict)\n\nUpload an artifact for a given trial in the study. The artifact is a .jld2 file containing the provided data.\n\nArguments\n\nstudy::Study: The study to upload the artifact to. (see Study)\ntrial::Trial: The trial to associate the artifact with. (see Trial)\ndata::Dict: The data to be stored as an artifact.\n\n\n\n\n\n","category":"function"},{"location":"api/#Optuna.get_all_artifact_meta","page":"API Reference","title":"Optuna.get_all_artifact_meta","text":"get_all_artifact_meta(study::Study)\n\nGet all artifact metadata for all trials in the given study.\n\nArguments\n\nstudy::Study: The study to get the artifact metadata from. (see Study)\n\nReturns\n\nVector{ArtifactMeta}: List of artifact metadata of all artifacts in the study.\n\n\n\n\n\nget_all_artifact_meta(study::Study, trial)\n\nGet all artifact metadata for the trial in the given study.\n\nArguments\n\nstudy::Study: The study to get the artifact metadata from. (see Study)\ntrial: The trial to get the artifact metadata from. (see Trial)\n\nReturns\n\nVector{ArtifactMeta}: List of artifact metadata of the given trial.\n\n\n\n\n\n","category":"function"},{"location":"api/#Optuna.download_artifact","page":"API Reference","title":"Optuna.download_artifact","text":"download_artifact(study::Study, artifact_id::String, file_path::String)\n\nDownload an artifact from a given study identified by its artifactid and the filepath where it should be stored.\n\nArguments\n\nstudy::Study: The study to download the artifact from. (see Study)\nartifact_id::String: The ID of the artifact to download.\nfile_path::String: The path where the downloaded artifact should be stored.\n\n\n\n\n\n","category":"function"},{"location":"api/#Optuna.Trial","page":"API Reference","title":"Optuna.Trial","text":"Trial is a data structure wrapper for an Optuna trial.\n\n\n\n\n\n","category":"type"},{"location":"api/#Optuna.suggest_int","page":"API Reference","title":"Optuna.suggest_int","text":"suggest_int(trial::Trial, name::String, low::T, high::T) where {T<:Signed}\n\nSuggest an integer value for the given parameter name within the specified range.\n\nArguments\n\ntrial::Trial: The trial to suggest the parameter for. (see Trial)\nname::String: The name of the parameter to suggest.\nlow::T: The lower bound of the range (inclusive).\nhigh::T: The upper bound of the range (inclusive).\n\nReturns\n\nT: Suggested integer value.\n\n\n\n\n\n","category":"function"},{"location":"api/#Optuna.suggest_float","page":"API Reference","title":"Optuna.suggest_float","text":"suggest_float(trial::Trial, name::String, low::T, high::T) where {T<:AbstractFloat}\n\nSuggest a float value for the given parameter name within the specified range.\n\nArguments\n\ntrial::Trial: The trial to suggest the parameter for. (see Trial)\nname::String: The name of the parameter to suggest.\nlow::T: The lower bound of the range (inclusive).\nhigh::T: The upper bound of the range (inclusive).\n\nReturns\n\nT: Suggested float value.\n\n\n\n\n\n","category":"function"},{"location":"api/#Optuna.suggest_categorical","page":"API Reference","title":"Optuna.suggest_categorical","text":"suggest_categorical(trial::Trial, name::String, choices::Vector{T}) where {T<:Union{Bool,Int,AbstractFloat,String}}\n\nSuggest a categorical value for the given parameter name from the specified choices.\n\nArguments\n\ntrial::Trial: The trial to suggest the parameter for. (see Trial)\nname::String: The name of the parameter to suggest.\nlow::T: The lower bound of the range (inclusive).\nhigh::T: The upper bound of the range (inclusive).\n\nReturns\n\nT: Suggested integer value.\n\n\n\n\n\n","category":"function"},{"location":"api/#Optuna.report","page":"API Reference","title":"Optuna.report","text":"report(trial::Trial, value::AbstractFloat, step::Int)\n\nReport an intermediate value for the given trial at a specific step.\n\nArguments\n\ntrial::Trial: The trial to report the value for. (see Trial)\nvalue::AbstractFloat: The intermediate value to report.\nstep::Int: The step at which the value is reported.\n\n\n\n\n\n","category":"function"},{"location":"api/#Optuna.should_prune","page":"API Reference","title":"Optuna.should_prune","text":"should_prune(trial::Trial)\n\nCheck if the given trial should be pruned based on the pruner's decision.\n\nArguments\n\ntrial::Trial: The trial to check for pruning. (see Trial)\n\nReturns\n\nBool: true if the trial should be pruned, false otherwise.\n\n\n\n\n\n","category":"function"},{"location":"api/#Optuna.optimize","page":"API Reference","title":"Optuna.optimize","text":"optimize(study::Study, objective::Function, params::NamedTuple; n_trials=100::Int)\n\nOptimize the objective function by choosing a suitable set of hyperparameter values from the given params.\n\nUses the sampler of the study which implements the task of value suggestion based on a specified distribution. For the available samplers see Sampler.\n\nIf the objective function returns nothing, the trial is pruned.\n\nArguments\n\nstudy::Study: Study that should be optimized.\nobjective::Function: Function that takes a trial and returns a score.\nparams::NamedTuple: Named tuple of parameters to optimize.\n\nKeyword Arguments\n\nn_trials::Int: Number of trials to run.\n\nReturns\n\nStudy: The optimized study. Study\n\n\n\n\n\n","category":"function"},{"location":"#Optuna.jl","page":"Home","title":"Optuna.jl","text":"(Image: Docs) (Image: Build Status) (Image: ColPrac: Contributor's Guide on Collaborative Practices for Community Packages) (Image: Code Style: Blue)\n\nOptuna.jl is a software package for the Julia programming language that provides an API Interface for the open source hyperparameter optimization framework Optuna.\n\nThis package is based on the Python API that is provided by Preferred Networks, Inc. in their GitHub repository.\n\n“Optuna, the Optuna logo and any related marks are trademarks of Preferred Networks, Inc.”","category":"section"},{"location":"#How-to-use-Optuna.jl","page":"Home","title":"How to use Optuna.jl","text":"Open the Jula REPL. Type ] to open the package manager.\nInstall Optuna\n\n    pkg> add Optuna\n\nExamples for hyperparameter optimization are provided in the examples folder. You can also refer to the documentation for further information.","category":"section"},{"location":"#How-to-contribute","page":"Home","title":"How to contribute","text":"Contributors are welcome. Before contributing, please read, understand and follow the Contributor's Guide on Collaborative Practices for Community Packages.","category":"section"}]
